pega.ui.Formatter.checkValidDateForChineseLocale = function(dateString) {
  var re = /\D*(\d*)\D*(\d*)\D*(\d*)\D*/;
	var result = re.exec(dateString);
	if(null == result) {
		return null;
	}
  
	var year = date_parseYearPart(result[1]);
  var month = date_parseDatePart(result[2]);
  var date = date_parseDatePart(result[3]);
	
  return date_isDateValid(date, month, year) ? new date_ValDate(date, month, year) : null
};//SE52318---end

pega.ui.Formatter.getTimeFrame = function(timeStamp, timeframe, showTimeNo, context) {
    var secNoCutoff = timeframe.secNoCutoff;
    var propType = timeframe.propType;
    if (secNoCutoff != "") {
        try {
            secNoCutoff = parseInt(secNoCutoff);
        } catch (e) {
            secNoCutoff = -1;
        }
    }
    if (isNaN(timeStamp) && timeStamp.indexOf("GMT") == -1) {
        var processedDate = pega.u.d.wrapperProcessDate(timeStamp, showTimeNo);
        timeStamp = new Date(processedDate);
        var ts = "";
        var year = timeStamp.getUTCFullYear();
        var month = timeStamp.getUTCMonth() + 1;
        var date = timeStamp.getUTCDate();
        var hours = timeStamp.getUTCHours();
        var minutes = timeStamp.getUTCMinutes();
        var seconds = timeStamp.getUTCSeconds();
        //var ms = timeStamp.getMilliseconds();
        ts += year + "";
        ts += (month < 10) ? "0" + month : month;
        ts += (date < 10) ? "0" + date : date;
        ts += "T";
        ts += (hours < 10) ? "0" + hours : hours;
        ts += (minutes < 10) ? "0" + minutes : minutes;
        ts += (seconds < 10) ? "0" + seconds : seconds;
        ts += ".";
        ts += "000 GMT";
        timeStamp = ts;
    }
    if (propType == "TimeOfDay" && timeStamp.indexOf("GMT") != -1) {
        timeStamp = timeStamp.substr(9, 6);
    }
    if (propType == "TimeOfDay") {
        var tempDate = new Date();
        var day = tempDate.getUTCDate();
        var month = tempDate.getUTCMonth();
        var year = tempDate.getUTCFullYear();
        var hours = parseInt(timeStamp.substr(0, 2));
        var minutes = parseInt(timeStamp.substr(2, 2));
        var seconds = parseInt(timeStamp.substr(4, 2));
        var propertyLocalDate = new Date(Date.UTC(year, month, day, hours, minutes, seconds, 0));
        var currentDate = new Date();
    } else if (propType == "Date") {
        var day = parseInt(timeStamp.substr(6, 2));
        var month = parseInt(timeStamp.substr(4, 2)) - 1;
        var year = parseInt(timeStamp.substr(0, 4));
        var propertyLocalDate = new Date(year, month, day, 0, 0, 0, 0);
        propertyLocalDate.setHours(0);
        propertyLocalDate.setMinutes(0);
        propertyLocalDate.setSeconds(0);
        propertyLocalDate.setMilliseconds(0);
        var currentDate = new Date();
        currentDate.setHours(0);
        currentDate.setMinutes(0);
        currentDate.setSeconds(0);
        currentDate.setMilliseconds(0);
    } else {
        var year = parseInt(timeStamp.substr(0, 4));
        var month = parseInt(timeStamp.substr(4, 2)) - 1;
        var day = parseInt(timeStamp.substr(6, 2));
        var hours = parseInt(timeStamp.substr(9, 2));
        var minutes = parseInt(timeStamp.substr(11, 2));
        var seconds = parseInt(timeStamp.substr(13, 2));
        var ms = parseInt(timeStamp.substr(16, 3));
        if (isNaN(hours)) {
            hours = 0;
        }
        if (isNaN(minutes)) {
            minutes = 0;
        }
        if (isNaN(seconds)) {
            seconds = 0;
        }
        if (isNaN(ms)) {
            ms = 0;
        }
        var propertyLocalDate = new Date(Date.UTC(year, month, day, hours, minutes, seconds, ms));
        var currentDate = new Date();
        /**Modified below line for BUG-622984 Fix*/
        if(propertyLocalDate.getFullYear() === currentDate.getFullYear() && propertyLocalDate.getMonth() === currentDate.getMonth() && propertyLocalDate.getDate() === currentDate.getDate() && propertyLocalDate.getHours() === currentDate.getHours() && propertyLocalDate.getMinutes() === currentDate.getMinutes()){
       var skipSettingSecToZero = true
          }
        /**End**/
        if(timeframe && timeframe.fromNow && !skipSettingSecToZero){
          propertyLocalDate = new Date(Date.UTC(year, month, day, hours, minutes, 0, 0));
          currentDate.setSeconds(0);
      	  currentDate.setMilliseconds(0);
        }
    }

    var toAdd = ((propertyLocalDate - currentDate) > 0) ? 1 : -1;
    var sDisplay = toAdd == 1 ? "from now" : "ago";
    if (timeframe.formatType == "DateTime-Frame-Short") {
        sDisplay = toAdd == 1 ? "in" : "ago";
    }
    var result = "";
    var years = 0,
        months = 0,
        days = 0;
    var diff = 0;
    var arg1 = 0;
    var arg2 = 0;
    var counta1 = 0;
    var counta2 = 0;
    if (propType != "TimeOfDay") {
        if (toAdd == 1 && propType == "Date") {
            propertyLocalDate.setUTCSeconds(propertyLocalDate.getUTCSeconds() + 1);
        }
        // years
        diff = (propertyLocalDate - currentDate) / 60000;
        diff /= 527040;
        years = (diff < 1 && diff > -1) ? 0 : parseInt(diff);
        currentDate.setUTCFullYear(currentDate.getUTCFullYear() + years);
        years = Math.abs(years);
        var tempDate = new Date();
        tempDate.setTime(currentDate.getTime());
        tempDate.setUTCFullYear(tempDate.getUTCFullYear() + toAdd);
        while ((toAdd == 1 && tempDate <= propertyLocalDate) || (toAdd == -1 && tempDate >= propertyLocalDate)) {
            years++;
            currentDate.setUTCFullYear(currentDate.getUTCFullYear() + toAdd);
            tempDate.setUTCFullYear(tempDate.getUTCFullYear() + toAdd);
        }
        // months
        diff = (propertyLocalDate - currentDate) / 60000;
        diff /= 44640;
        months = (diff < 1 && diff > -1) ? 0 : parseInt(diff);
        currentDate.setUTCMonth(currentDate.getUTCMonth() + months);
        months = Math.abs(months);
        tempDate.setTime(currentDate.getTime());
        tempDate.setUTCMonth(tempDate.getUTCMonth() + toAdd);
        if ((toAdd == 1 && tempDate <= propertyLocalDate) || (toAdd == -1 && tempDate >= propertyLocalDate)) {
            months++;
            currentDate.setUTCMonth(currentDate.getUTCMonth() + toAdd);
            tempDate.setUTCMonth(tempDate.getUTCMonth() + toAdd);
        }
        //days
        diff = (propertyLocalDate - currentDate) / 60000;
        diff /= 1440;
        days = (diff < 1 && diff > -1) ? 0 : parseInt(diff);
        currentDate.setUTCDate(currentDate.getUTCDate() + days);
        days = Math.abs(days);
        diff = parseInt(Math.abs((propertyLocalDate - currentDate) / 3600000));
        var hours = parseInt(diff);
        if (years > 0) {
            arg1 = years;
            result += "{1}";
            result += ((years > 1) ? "years" : "year");
            if ((secNoCutoff == -1 || years < secNoCutoff) && months > 0) {
                arg2 = months;
                result += "{2}";
                result += ((months > 1) ? "months" : "month");
            }
            if (timeframe.formatType == "DateTime-Frame-Short") {
                result = result.replace(/years?/g, "y");
                result = result.replace(/months?/g, "mo");
            }
        } else if (months > 0) {
            arg1 = months;
            result += "{1}";
            result += ((months > 1) ? "months" : "month");
            if ((secNoCutoff == -1 || months < secNoCutoff) && days > 0) {
                arg2 = days;
                result += "{2}";
                result += ((days > 1) ? "days" : "day");
            }
            if (timeframe.formatType == "DateTime-Frame-Short") {
                result = result.replace(/months?/g, "mo");
                result = result.replace(/days?/g, "d");
            }
        } else if (days > 0) {
            arg1 = days;
            result += "{1}";
            result += ((days > 1) ? "days" : "day");
            if ((secNoCutoff == -1 || days < secNoCutoff) && hours > 0 && propType != "Date") {
                arg2 = hours;
                result += "{2}";
                result += ((hours > 1) ? "hours" : "hour");
            }
            if (timeframe.formatType == "DateTime-Frame-Short") {
                result = result.replace(/days?/g, "d");
                result = result.replace(/hours?/g, "h");
            }
        } else if (propType == "Date") {
            return "today";
        }
    }
    if (propType != "Date" && (years + months + days) == 0) {
        diff = parseInt(Math.abs((propertyLocalDate - currentDate) / 60000));
        var min = parseInt(diff);
        var hours = min / 60;
        hours = parseInt(hours);
        min = min % 60;
        if (hours > 0) {
            arg1 = hours;
            result += "{1}";
            result += ((hours > 1) ? "hours" : "hour");
            if ((secNoCutoff == -1 || hours < secNoCutoff) && min > 0) {
                arg2 = min;
                result += "{2}";
                result += ((min > 1) ? "minutes" : "minute");
            }
            if (timeframe.formatType == "DateTime-Frame-Short") {
                result = result.replace(/hours?/g, "h");
                result = result.replace(/minutes?/g, "m");
            }
        } else if (min > 1) {
            arg1 = min;
            result += "{1}";
            result += ((min > 1) ? "minutes" : "minute");
            if (timeframe.formatType == "DateTime-Frame-Short") {
                result = result.replace(/minutes?/g, "m");
            }

        } else {
            if (timeframe.formatType == "DateTime-Frame-Short") {
                result += "{1}m";
              	arg1 = "1";
            } else if (min > 0) {
                result += "about a minute";
            } else {
                result += "less than a minute";
            }
        }
    }
    var showPastFuture = "true";
    if (timeframe.formatType == "DateTime-Frame-Short") {
        if (timeframe.pyDontShowPastFuture == "true") {
            showPastFuture = "false";
        }
    }
    if (result) {
        if (showPastFuture == "true") {
            if (sDisplay == "in") {
                result = sDisplay + " " + result;
            } else {
                result += " " + sDisplay;
            }
        } else {
            if (sDisplay == "ago") {
                //result = "-" + result;
                arg1 = "-" + arg1;
            }
        }
      	if(context){
          var tempResult = result;
            //Remove place holders before getting localized value. These placeholders are needed to replace args incase of localization is disabled 
            result = result.replace('{1}', '').replace('{2}', '');
          	var valueBefore = result;
      		var localizedValue = context.getLocalizedValue(valueBefore, "pyFormatter");
          	if(localizedValue && valueBefore != localizedValue){
               if(localizedValue.indexOf("{1}") != -1){
                 result = localizedValue.replace(/\{1\}/g, arg1).replace(/\{2\}/g, arg2);
               } else {
                 result = localizedValue;
               }
            } else {
              if (timeframe.formatType == "DateTime-Frame-Short")
               result = tempResult.replace(/\{1\}/g, arg1).replace(/\{2\}/g, (arg2 ? ' ' + arg2  : ''));
          	  else
                result = tempResult.replace(/\{1\}/g, arg1 + ' ').replace(/\{2\}/g, (arg2 ? ' ' + arg2 + ' ' : ''));
            } 	
      	}
   	} 	
    return result;
};

pega.ui.Formatter.getDisplayFormatValue = function(value, modePage, showTimeNo, customTimeZone, hasError) {
  var fromNowConfig;
  if (modePage.pyDateTimeFormat == "DateTime-Frame" || modePage.pyDateTimeFormat == "DateTime-Frame-Short") {
    fromNowConfig = {};
    fromNowConfig.fromNow = true;
    fromNowConfig.type = modePage.pyFormatType;
    fromNowConfig.secNoCutoff = modePage.pyDateTimeSecondCutoff;
    fromNowConfig.propType = modePage.pyPropertyType;
    fromNowConfig.formatType = modePage.pyDateTimeFormat;
    if (modePage.pyDateTimeFormat == "DateTime-Frame-Short") {
      fromNowConfig.pyDontShowPastFuture = modePage.pyDontShowPastFuture;
    }
  } else if (modePage.pyDateFormat == "DateTime-Frame" || modePage.pyDateFormat == "DateTime-Frame-Short") {
    fromNowConfig = {};
    fromNowConfig.fromNow = true;
    fromNowConfig.type = modePage.pyFormatType;
    fromNowConfig.secNoCutoff = modePage.pyDateTimeSecondCutoff;
    fromNowConfig.propType = modePage.pyPropertyType;
    fromNowConfig.formatType = modePage.pyDateFormat;
    if (modePage.pyDateFormat == "DateTime-Frame-Short") {
      fromNowConfig.pyDontShowPastFuture = modePage.pyDontShowPastFuture;
    }
  }
  return pega.ui.Formatter.formatDateTime(value, modePage.pyCustDateTime, fromNowConfig, modePage.pyDateTimeHourFormat, "", showTimeNo, null, customTimeZone, hasError);
};
